import React from 'react';

function About() {
    return(
        <>
        <div class="border p-5 m-3">
        <h1 id="about" class="text-center">About Me</h1>
        <p>Hello, thanks for stopping by this page. My name is Madison Schaaf. I have a Bachelors of Science in Psychology with a Masters of Education in Special Education. I have taught for the last 5 years and am looking to challenge myself in software development. I am currently learning full stack development to strengthen my skills in the tech industry. I have loved teaching for the last few years and am looking to expand my knowledge and challenge myself in other areas as well. I am hopeful to find a role where I can utilize my full stack development skills with a company that I can grow with.</p>
        <div class="resume">
            <a class="text-[white]" href="./assets/images/Resume- Madison Schaaf (Updated 4_2022 tech).pdf" target="_blank">Download my resume </a> & Follow me on <a class="text-[#2563eb]" href ="https://www.linkedin.com/in/madison-schaaf-b3b892102/"target ="_blank"> LinkedIn <span class="iconify" data-icon="fa:linkedin" style="color: blue;"></span></a>
          </div>
        </div>
        </>
    )
}

export default About;
